/* --------------------------- Optional helper ---------------------------- */
/** Convenience hook so parent code stays clean */
export function useMenu() {
  const [open, setOpen] = useState(false);

  const api = useMemo(
    () => ({
      open,
      setOpen,
      toggle: () => setOpen((v) => !v),
      close: () => setOpen(false),
    }),
    [open],
  );

  return api;
}
